import Layout from '../../components/Layout';

export default function Listing() {

  return (
    <Layout>
        
        <Link href="/listing/[id]" as={`/listing/${props.id}`}>
        <a>{props.id}</a>
        </Link>
        
      <p>This is the blog post content.</p>
    </Layout>
  );
}
